import React,{Component} from 'react';
import {
        ListItem,
        ListInfo,
        ListLine,
        ListAciton,
} from '../style';

class List extends Component{
    render(){
        return (
            <div>

                <ListLine/>
                <ListItem>
                        <img className="pic" src="//upload-images.jianshu.io/upload_images/14524620-b3352a48f9e7cf13.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240"></img>
                    <ListInfo>

                        <h3 className="title">超爽口的下饭神器，要不要来一罐？</h3>
                        <p className="desc">纯手工自制，食材简单，但味道不简单～ 食材：白萝卜，胡萝卜，杭椒，小米辣，泡椒（水） 配料：花椒，大蒜切片，盐，白醋，泡椒水，白砂糖或冰糖 做法...</p>
                        <ListAciton>
                        <a className="action">极物</a>
                        <a className="action">36</a>
                        <span className="action">734</span>
                        </ListAciton>
                    </ListInfo>

                </ListItem>
            </div>

        )
    }
}

export default List;
